 * 1ï¸âƒ£ **Dapp Ä‘Äƒng kÃ½ há»‡ thá»‘ng thÃ´ng bÃ¡o:**
 *    - Dapp gá»i `registerDapp()` trÃªn `NotiFactory`.
 *    - `NotiFactory` triá»ƒn khai `PermissionManager` & `NotiStorage` riÃªng cho Dapp Ä‘Ã³.
 *    - `NotiStorage` Ä‘Æ°á»£c Ä‘Äƒng kÃ½ trÃªn `NotiHub` Ä‘á»ƒ gá»­i thÃ´ng bÃ¡o lÃªn off-chain.
 *
 * 2ï¸âƒ£ **NgÆ°á»i dÃ¹ng Ä‘Äƒng kÃ½ nháº­n thÃ´ng bÃ¡o tá»« Dapp:**
 *    - NgÆ°á»i dÃ¹ng gá»i `subscribeUser(dappAddress, publicKey, encryptedDeviceToken)`.
 *    - `NotiFactory` gá»i `registerUser(userAddress)` trÃªn `PermissionManager` cá»§a Dapp.
 *    - NgÆ°á»i dÃ¹ng gá»­i thÃªm **publicKey** vÃ  **encryptedDeviceToken** (mÃ£ hÃ³a báº±ng ECDH).
 *    - **Sá»± kiá»‡n `UserSubscribed` phÃ¡t ra** Ä‘á»ƒ backend xá»­ lÃ½ lÆ°u trá»¯ token cá»§a thiáº¿t bá»‹.
 *
 * 3ï¸âƒ£ **Dapp gá»­i thÃ´ng bÃ¡o Ä‘áº¿n ngÆ°á»i dÃ¹ng:**
 *    - Dapp gá»i `sendNotification(user, message)` trÃªn `NotiStorage`.
 *    - `NotiStorage` kiá»ƒm tra quyá»n cá»§a user qua `PermissionManager`.
 *    - Náº¿u há»£p lá»‡, thÃ´ng bÃ¡o Ä‘Æ°á»£c lÆ°u vÃ o blockchain & phÃ¡t sá»± kiá»‡n `NotificationSent`.
 *    - `NotiStorage` gá»i `emitNotification()` trÃªn `NotiHub` Ä‘á»ƒ broadcast lÃªn off-chain.
 *
 * 4ï¸âƒ£ **Há»‡ thá»‘ng off-chain láº¯ng nghe thÃ´ng bÃ¡o tá»« `NotiHub`:**
 *    - **NotiHub phÃ¡t sá»± kiá»‡n `GlobalNotification`** khi cÃ³ thÃ´ng bÃ¡o tá»« Dapp.
 *    - Há»‡ thá»‘ng off-chain láº¯ng nghe sá»± kiá»‡n nÃ y vÃ  xá»­ lÃ½ gá»­i push notification Ä‘áº¿n user.
 *
 * 5ï¸âƒ£ **NgÆ°á»i dÃ¹ng quáº£n lÃ½ thÃ´ng bÃ¡o cá»§a mÃ¬nh:**
 *    - **Láº¥y danh sÃ¡ch thÃ´ng bÃ¡o**: `getNotiList(startIndex, limit)`.
 *    - **ÄÃ¡nh dáº¥u Ä‘Ã£ Ä‘á»c**: `markRead(eventId)`, `markAllRead(beforeTime)`.
 *    - **XÃ³a thÃ´ng bÃ¡o**: `deleteNoti(eventId)`.
