import "@openzeppelin/contracts/access/Ownable.sol";

contract PermissionManager {
    address public notiFactory;
    address public dappOwner;
    mapping(address => uint256) public users; // LÆ°u thá»i Ä‘iá»ƒm user Ä‘Äƒng kÃ½

    modifier onlyDappOwner() {
        require(msg.sender == dappOwner, "Not authorized");
        _;
    }

    modifier onlyNotiFactory() {
        require(msg.sender == notiFactory, "Only NotiFactory can register users");
        _;
    }

    constructor(address _dappOwner, address _notiFactory) {
        dappOwner = _dappOwner;
        notiFactory = _notiFactory;
    }

    /**
     * @notice ÄÄƒng kÃ½ ngÆ°á»i dÃ¹ng vÃ o há»‡ thá»‘ng thÃ´ng bÃ¡o cá»§a Dapp
     * @dev Chá»‰ Dapp hoáº·c chÃ­nh user cÃ³ thá»ƒ Ä‘Äƒng kÃ½
     * @param _user Äá»‹a chá»‰ cá»§a ngÆ°á»i dÃ¹ng cáº§n Ä‘Äƒng kÃ½
     */
    function registerUser(address _user) external onlyNotiFactory {
        users[_user] = block.timestamp;
    }

    /**
     * @notice Há»§y Ä‘Äƒng kÃ½ ngÆ°á»i dÃ¹ng khá»i há»‡ thá»‘ng
     * @dev Chá»‰ Dapp hoáº·c chÃ­nh user cÃ³ thá»ƒ há»§y
     */
    function unregisterUser() external {
        require(users[msg.sender] > 0, "Unauthorized");
        users[msg.sender] = 0;
    }

    /**
     * @notice Kiá»ƒm tra ngÆ°á»i dÃ¹ng cÃ³ Ä‘Äƒng kÃ½ khÃ´ng
     * @param _user Äá»‹a chá»‰ ngÆ°á»i dÃ¹ng
     * @return bool True náº¿u user Ä‘Ã£ Ä‘Äƒng kÃ½, False náº¿u chÆ°a
     */
    function isUserRegistered(address _user) external view onlyDappOwner returns (bool) {
        return users[_user] > 0;
    }
}

/**
 * @title NotiHub
 * @notice Trung tÃ¢m tiáº¿p nháº­n táº¥t cáº£ thÃ´ng bÃ¡o tá»« cÃ¡c Dapp.
 * @dev Chá»‰ nháº­n thÃ´ng bÃ¡o tá»« cÃ¡c NotiStorage há»£p lá»‡ do NotiFactory Ä‘Äƒng kÃ½.
 */
contract NotiHub is Ownable{
    mapping(address => bool) public allowedNotiStorages; // Danh sÃ¡ch cÃ¡c NotiStorage há»£p lá»‡
    address public notiFactory; // Äá»‹a chá»‰ NotiFactory

    event GlobalNotification(
        address indexed dappOwner,
        address indexed user,
        uint256 eventId,
        string message
    );

    modifier onlyAllowedNotiStorage() {
        require(allowedNotiStorages[msg.sender], "Not authorized");
        _;
    }

    modifier onlyNotiFactory() {
        require(msg.sender == notiFactory, "Only NotiFactory can register");
        _;
    }

    // constructor(address _notiFactory) {
    //     notiFactory = _notiFactory;
    // }
    constructor()Ownable(msg.sender){}

    function setNotiFactory(address _notiFactory)external onlyOwner{
        notiFactory =  _notiFactory;
    }    
    /**
     * @notice Chá»‰ NotiFactory cÃ³ thá»ƒ Ä‘Äƒng kÃ½ NotiStorage há»£p lá»‡
     * @param notiStorage Äá»‹a chá»‰ NotiStorage cáº§n cáº¥p quyá»n
     */
    function registerNotiStorage(address notiStorage) external onlyNotiFactory {
        allowedNotiStorages[notiStorage] = true;
    }

    /**
     * @notice PhÃ¡t sá»± kiá»‡n khi cÃ³ thÃ´ng bÃ¡o má»›i
     * @dev Chá»‰ cháº¥p nháº­n tá»« cÃ¡c NotiStorage há»£p lá»‡
     */
    function emitNotification(
        address dappOwner,
        address user,
        uint256 eventId,
        string calldata message
    ) external onlyAllowedNotiStorage {
        emit GlobalNotification(dappOwner, user, eventId, message);
    }
}


contract NotiStorage {
    address public dappOwner;
    PermissionManager public permissionManager;
    NotiHub public notiHub; // ThÃªm tham chiáº¿u Ä‘áº¿n NotiHub

    struct Notification {
        uint256 eventId;
        string message;
        uint256 timestamp;
        bool isRead;
    }

    mapping(address => uint256[]) private mEventList;
    mapping(uint256 => Notification) private mEventInfo;

    event NotificationSent(address indexed user, uint256 eventId, string message);
    event NotificationRead(address indexed user, uint256 eventId);
    event NotificationDeleted(address indexed user, uint256 eventId);

    modifier onlyDappOwner() {
        require(msg.sender == dappOwner, "Not authorized");
        _;
    }

    constructor(address _dappOwner, address _permissionManager, address _notiHub) {
        dappOwner = _dappOwner;
        permissionManager = PermissionManager(_permissionManager);
        notiHub = NotiHub(_notiHub); // Khá»Ÿi táº¡o Ä‘á»‹a chá»‰ NotiHub
    }

    /**
     * @notice Gá»­i thÃ´ng bÃ¡o Ä‘áº¿n má»™t ngÆ°á»i dÃ¹ng
     * @dev Chá»‰ Dapp má»›i cÃ³ quyá»n gá»­i thÃ´ng bÃ¡o
     * @param _user Äá»‹a chá»‰ ngÆ°á»i nháº­n
     * @param _message Ná»™i dung thÃ´ng bÃ¡o
     */
    function sendNotification(address _user, string calldata _message) external onlyDappOwner {
        require(permissionManager.isUserRegistered(_user), "User not registered");

        uint256 eventId = uint256(keccak256(abi.encodePacked(block.timestamp, _user, _message)));
        Notification memory newNoti = Notification(eventId, _message, block.timestamp, false);

        mEventInfo[eventId] = newNoti;
        mEventList[_user].push(eventId);

        emit NotificationSent(_user, eventId, _message);

        // Gá»­i sá»± kiá»‡n lÃªn NotiHub Ä‘á»ƒ off-chain báº¯t má»™t nÆ¡i duy nháº¥t
        notiHub.emitNotification(dappOwner, _user, eventId, _message);
    }

    /**
     * @notice Láº¥y danh sÃ¡ch thÃ´ng bÃ¡o cá»§a ngÆ°á»i dÃ¹ng (phÃ¢n trang)
     * @param _user Äá»‹a chá»‰ ngÆ°á»i dÃ¹ng
     * @param startIndex Vá»‹ trÃ­ báº¯t Ä‘áº§u
     * @param limit Sá»‘ lÆ°á»£ng thÃ´ng bÃ¡o cáº§n láº¥y
     * @return Notification[] Danh sÃ¡ch thÃ´ng bÃ¡o
     */
    function getNotiList(address _user, uint256 startIndex, uint256 limit) external view returns (Notification[] memory) {
        require(permissionManager.isUserRegistered(_user), "User not registered");

        uint256 total = mEventList[_user].length;
        if (startIndex >= total) return new Notification[](0) ;

        uint256 fetchCount = (total - startIndex > limit) ? limit : total - startIndex;
        Notification[] memory notiList = new Notification[](fetchCount);

        for (uint256 i = 0; i < fetchCount; i++) {
            notiList[i] = mEventInfo[mEventList[_user][startIndex + i]];
        }

        return notiList;
    }
}

contract NotiFactory is Ownable {
    struct DappContracts {
        address permissionManager;
        address notiStorage;
    }

    /**
     * @notice Sá»± kiá»‡n phÃ¡t ra khi user Ä‘Äƒng kÃ½ nháº­n thÃ´ng bÃ¡o tá»« Dapp
     * @param user Äá»‹a chá»‰ user Ä‘Äƒng kÃ½
     * @param dapp Äá»‹a chá»‰ Dapp
     * @param permissionManager Äá»‹a chá»‰ contract PermissionManager cá»§a Dapp
     * @param publicKey Public key ngáº«u nhiÃªn cá»§a user dÃ¹ng Ä‘á»ƒ mÃ£ hÃ³a ECDH
     * @param encryptedDeviceToken Token cá»§a device Ä‘Ã£ mÃ£ hÃ³a
     */
    event UserSubscribed(
        address indexed user, 
        address indexed dapp, 
        address permissionManager, 
        bytes32 publicKey, 
        bytes encryptedDeviceToken
    );

    mapping(address => DappContracts) public dappToContracts;
    address[] public dappList;
    NotiHub public notiHub; // Tham chiáº¿u Ä‘áº¿n NotiHub

    event DappRegistered(address indexed dappOwner, address permissionManager, address notiStorage);
    event UserSubscribed(address indexed user, address indexed dapp, address permissionManager);


    // constructor(address _notiHub) {
    //     notiHub = NotiHub(_notiHub);
    // }
    constructor() Ownable(msg.sender){}
    function setNotiHub(address _notiHub) external onlyOwner {
        notiHub = NotiHub(_notiHub);
    }
    /**
     * @notice ÄÄƒng kÃ½ Dapp vá»›i há»‡ thá»‘ng thÃ´ng bÃ¡o
     * @dev Chá»‰ cáº§n gá»i 1 láº§n duy nháº¥t, sáº½ triá»ƒn khai PermissionManager & NotiStorage
     */
    function registerDapp() external {
        require(dappToContracts[msg.sender].permissionManager == address(0), "Dapp already registered");

        PermissionManager permissionManager = new PermissionManager(msg.sender, address(this));
        NotiStorage notiStorage = new NotiStorage(msg.sender, address(permissionManager), address(notiHub));

        dappToContracts[msg.sender] = DappContracts(address(permissionManager), address(notiStorage));
        dappList.push(msg.sender);

        // ÄÄƒng kÃ½ NotiStorage vÃ o NotiHub
        notiHub.registerNotiStorage(address(notiStorage));

        emit DappRegistered(msg.sender, address(permissionManager), address(notiStorage));
    }

    /**
     * @notice NgÆ°á»i dÃ¹ng Ä‘Äƒng kÃ½ nháº­n thÃ´ng bÃ¡o tá»« má»™t Dapp
     * @dev Gá»­i kÃ¨m token cá»§a device (Ä‘Ã£ mÃ£ hÃ³a báº±ng ECDH) + public key cá»§a user
     * @param dappOwner Äá»‹a chá»‰ cá»§a Dapp cáº§n Ä‘Äƒng kÃ½
     * @param publicKey Public key ngáº«u nhiÃªn cá»§a user Ä‘á»ƒ backend dÃ¹ng ECDH giáº£i mÃ£
     * @param encryptedDeviceToken Token cá»§a device Ä‘Ã£ mÃ£ hÃ³a
     */
    function subscribeUser(
        address dappOwner, 
        bytes32 publicKey, 
        bytes calldata encryptedDeviceToken
    ) external {
        require(dappToContracts[dappOwner].permissionManager != address(0), "Dapp not registered");

        PermissionManager permissionManager = PermissionManager(dappToContracts[dappOwner].permissionManager);
        permissionManager.registerUser(msg.sender);

        emit UserSubscribed(msg.sender, dappOwner, address(permissionManager), publicKey, encryptedDeviceToken);
    }

    /**
     * @notice Láº¥y Ä‘á»‹a chá»‰ cá»§a PermissionManager & NotiStorage cá»§a má»™t Dapp
     * @param dappOwner Äá»‹a chá»‰ Dapp
     * @return (address, address) Äá»‹a chá»‰ PermissionManager & NotiStorage
     */
    function getDappContracts(address dappOwner) external view returns (address, address) {
        return (
            dappToContracts[dappOwner].permissionManager,
            dappToContracts[dappOwner].notiStorage
        );
    }

    /**
     * @notice Láº¥y danh sÃ¡ch táº¥t cáº£ Dapp Ä‘Ã£ Ä‘Äƒng kÃ½ há»‡ thá»‘ng thÃ´ng bÃ¡o
     * @return address[] Danh sÃ¡ch Dapp
     */
    function getAllDapps() external view returns (address[] memory) {
        return dappList;
    }
}

